import './Expenses.css';
import ExpenseItem from './ExpenseItem';
import Card from '../UI/Card';

export default function Expenses({ data }) {
  const { log } = console;

  return (
    <Card className='expenses'>
      {data.map((listObj) => (
        <ExpenseItem 
          key={listObj.id}
          title={listObj.title} 
          amount={listObj.amount}
          date={listObj}>
        </ExpenseItem>
      ))}
    </Card>
  );
}
